script.xsl:text:
(
function() {

	// this script is a crime against computers, i dont like JS just wanted to have something working and move on
	// it does some button tasks, sets active some clickables, open-close containers and implements a search feature

    const main = document.getElementById('view');

	const obj_xml_closables= document.getElementsByClassName('closable-block');
	const obj_xml_searchableparents= document.getElementsByClassName('searchable-parent');
	const obj_xml_searchables= document.getElementsByClassName('searchable');

	const obj_srch_totalmatches= document.getElementsByClassName('totalmatches')[0];
	const obj_srch_buttonclear= document.getElementById('clearsearch');
	const obj_srch_textbox= document.getElementsByClassName('searchbox')[0];

	var obj_item_activecurrent;

    document.addEventListener('click', function(e) {
        if (!e.target) return;

		// buttons sorted by usage probability

		// TOGGLE ACTIVE ELEMENT, toggles "active" class on items for CSS
        if (e.target.matches('.item > .head')) {

			if(obj_item_activecurrent) obj_item_activecurrent.parentNode.classList.remove('active');
			if(obj_item_activecurrent != e.target){
				e.target.parentNode.classList.add('active');
				obj_item_activecurrent= e.target;
			}
			else obj_item_activecurrent= undefined;
            return;
        }

		// TOGGLE OPENSTATE BUTTON, open/close a container
        if (e.target.matches('.closable > .head')) {
			clearCurrentItem();
			obj= e.target.parentNode;
			if(!obj.classList.contains('locked')) obj.classList.toggle('hidden');
            return;
        }

		// TOGGLE BUTTON, toggles "pressed" class, also toggles a class defined in the button's ID at html's body/#view
        if (e.target.matches('.button.tgl')) {
			e.target.classList.toggle('pressed');
            main.classList.toggle(e.target.id);
            return;
        }

		// ACTION BUTTON
		// -- expand/collapse = toggles "hidden" class if doesnt contains "locked" class (used for searching tasks)
        // -- clearsearch = clears search textbox
		if (e.target.matches('.button.act')) {

			clearCurrentItem();

			switch(e.target.id) {
				case "collapse":
					for (const i of obj_xml_closables) if(!i.classList.contains('locked')) i.classList.add('hidden');
					break;
				case "expand":
					for (const i of obj_xml_closables) if(!i.classList.contains('locked')) i.classList.remove('hidden');
					break;
				case "clearsearch":
					obj_srch_textbox.value= "";
					obj_srch_textbox.innerHTML= "";
					updateSearch("");
					break;
			}
        }

		// CLOSE BUTTON, the LOCAL collapse button
        if (e.target.matches('.close')) {
			clearCurrentItem();
			var refobject= e.target.parentNode.parentNode.parentNode;
			var closables = refobject.getElementsByClassName('closable');
			for (const i of closables) if (i.parentNode.parentNode == refobject) i.classList.add('hidden');
            return;
        }

		// OPEN BUTTON, the LOCAL expand button
        if (e.target.matches('.open')) {
			clearCurrentItem();
			var refobject= e.target.parentNode.parentNode.parentNode;
			var closables = refobject.getElementsByClassName('closable');
			for (const i of closables) if (i.parentNode.parentNode == refobject) i.classList.remove('hidden');
            return;
        }
    });

	// clears current active item
	function clearCurrentItem() {
		if(obj_item_activecurrent) {
			obj_item_activecurrent.parentNode.classList.remove('active');
			obj_item_activecurrent= undefined;
		}
	}

	document.getElementsByClassName("searchbox")[0].addEventListener('input', function(e) {
		updateSearch(e.target.value.toLowerCase());
	});

	// search tasks
	// NOTES (not actual code description)
	// it takes the user input as-is, no split by spaces nor any fancy thing, then test the string on every
	// child '.head > .query' of a '.searchable' / '.searchable-parent' element.
	// '.query' is a hidden element containing all the strings used to find that specific object
	// only the elements containing the input text in their '.query' are shown.
	// if a matching element has children, all of them are shown and only 1 "match" is counted
	function updateSearch(input) {

		clearCurrentItem();

		if (input === null || input.trim().length === 0)
		{
			for (const i of obj_xml_searchableparents) {
				i.classList.remove('srch-nomatch');
				i.classList.remove('srch-result');
			}
			for (const i of obj_xml_searchables) {
				i.classList.remove('srch-nomatch');
				i.classList.remove('srch-result');
			}
			for (const i of obj_xml_closables) {
				i.classList.remove('locked');
				i.classList.remove('srch-empty');
				i.classList.remove('srch-active');
				i.querySelector('.head > .attr.matches').innerHTML= "";
			}
			obj_srch_buttonclear.classList.add('hidden')
			obj_srch_totalmatches.innerHTML= "";
		}
		else {

			for (const i of obj_xml_closables) i.classList.add('srch-active');
			for (const i of obj_xml_searchableparents){

				if (i.querySelector('.head > .query').textContent.toLowerCase().includes(input)) {
					i.classList.remove('srch-nomatch');
					i.classList.add('srch-result');
				}
				else {
					i.classList.add('srch-nomatch');
					i.classList.remove('srch-result');
				}
			}

			for (const i of obj_xml_searchables) {

				var anyparent= anyParentResult(i);

				if (i.querySelector('.head > .query').textContent.toLowerCase().includes(input)) {
					i.classList.remove('srch-nomatch');
					i.classList.add('srch-result');
					showAllParents(i);
				}
				else {
					if(!anyparent) i.classList.add('srch-nomatch');
					else i.classList.remove('srch-nomatch');
					i.classList.remove('srch-result');
				}
			}

			totalmatches= 0;

			for (const i of obj_xml_closables) {

				nsearchables= i.getElementsByClassName('searchable').length + i.getElementsByClassName('searchable-parent').length	
				nnonmatches= i.getElementsByClassName('srch-nomatch').length
				nresults= i.getElementsByClassName('srch-result').length

				totalmatches+= nresults

				matchestext= i.querySelector('.head > .attr.matches')

				if(nresults <= 0) {
					i.classList.add('locked')
					i.classList.add('hidden')
					i.classList.add('srch-empty')
					matchestext.innerHTML= "(no matches)"
				}
				else {
					i.classList.remove('locked')
					i.classList.remove('hidden')
					i.classList.remove('srch-empty')
					matchestext.innerHTML= "(" + nresults + " matches)"
				}
			}

			obj_srch_buttonclear.classList.remove('hidden')
			obj_srch_totalmatches.innerHTML= totalmatches + " matches"
		}
	}

	// find if any parent is currently a srch-result
	function anyParentResult(obj) {
		while (obj.parentNode && obj.parentNode.classList) {
			obj = obj.parentNode;
			if (obj.classList.contains('srch-result')) return true;
		}
		return false;
	}

	// unhide all parents (prevent srch-result children to be hidden by their parent(s))
	function showAllParents(obj) {
		while (obj.parentNode && obj.parentNode.classList) {
			obj = obj.parentNode;
			obj.classList.remove('srch-nomatch');
		}
	}
}

)();
